import logo from './logo.svg';
import './App.css';
import Services from './components/Services';
import Work from './components/Work';
import Contact from './components/Contact';
import Footer from './components/Footer';

function App() {
  const handleLogoClick = () => {
    window.scrollTo(0, 0);
    window.location.reload();
  };

  return (
    <div className="flex flex-col min-h-screen">
      <nav className="fixed top-0 left-0 right-0 z-50 flex items-center justify-between bg-white shadow-lg px-6 py-3">
        <div className="flex items-center">
          <h1 className="font-bold text-lg cursor-pointer" onClick={handleLogoClick}>JDIA</h1>
        </div>
        <ul className="flex">
          <li className="mr-6">
            <a href="#services" className="text-gray-700 hover:text-blue-500 transition duration-200 ease-in-out">Services</a>
          </li>
          <li className="mr-6">
            <a href="#work" className="text-gray-700 hover:text-blue-500 transition duration-200 ease-in-out">Work</a>
          </li>
          <li>
            <a href="#contact" className="text-gray-700 hover:text-blue-500 transition duration-200 ease-in-out">Contact</a>
          </li>
        </ul>
      </nav>
      <header className="flex flex-col items-center justify-center bg-gray-800 py-16 h-[75vh]">

      </header>
      <main className="flex-grow flex flex-col">
        <div className="flex-grow flex justify-center items-center pt-20 services-section" id="services">
          <Services />
        </div>
        <div className="flex-grow flex justify-center items-center pt-20 work-section" id="work">
          <Work />
        </div>
        <div className="flex-grow flex justify-center items-center pt-20 contact-section" id="contact">
          <Contact />
        </div>
      </main>
      <Footer />
    </div>
  );
}

export default App;
